import React from "react";
import ReactDOM from "react-dom";

import "./style/index.css";

import { App } from "./Components/App/App";
import { Vocabulary } from "./Vocabulary";

ReactDOM.render(
  <App vocabulary={Vocabulary} />,
  document.getElementById("root")
);
